import axios from 'axios';

const baseUrl = 'https://testgraming.net';
const consumer_key = 'ck_de866a2819316f78ca384e75f2ae9d920ca65cbb';
const consumer_secret = 'cs_fdadbf0561f043d8e0ce537de4fc6a4650ab0740';

const FetchTikTokLikes = async (setTiktoklikes, setIsLoading, setError) => {
  try {
    const response = await axios.get(
      `${baseUrl}/wp-json/wc/v3/products?consumer_key=${consumer_key}&consumer_secret=${consumer_secret}`
    );

    const TikTokLikesData = response.data
      .filter(product => product.name === 'Buy Instagram Likes')
      .map(product => product.meta_data);

    console.log(TikTokLikesData);

    let products = [];
    let currentProduct = {};

    TikTokLikesData.forEach(item => {
      if (
        item.key.includes('quantity_options_') &&
        item.key.endsWith('_quantity')
      ) {
        // Начало нового продукта
        currentProduct = { id: item.id };
        currentProduct.quantity = item.value;
      } else if (
        item.key.includes('quantity_options_') &&
        item.key.endsWith('_price')
      ) {
        currentProduct.price = item.value;
      } else if (
        item.key.includes('quantity_options_') &&
        item.key.endsWith('_discount')
      ) {
        currentProduct.discount = item.value;
        // Когда собрали все поля, добавляем продукт в массив
        products.push(currentProduct);
      }
    });

    console.log(products);
    setTiktoklikes(products);
  } catch (error) {}
};

export default FetchTikTokLikes;
